private MultiCollector(Collector... collectors) {
  this.collectors = collectors;
  int numNeedsScores = 0;
  for (Collector collector : collectors) {
    if (collector.needsScores()) {
      numNeedsScores += 1;
    }
  }
  this.cacheScores = numNeedsScores >= 2;
}

